import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import CopyrightText from '../Components/CopyrightText.jsx';

import { signOut } from 'firebase/auth';
import { auth } from  '../firebase-config';

function HomePage() {
  const navigate = useNavigate();

  const handleLogout = () => {
    signOut(auth)
      .then(() => {
        console.log('Déconnexion réussie');
        alert('Déconnexion réussie');
        navigate('/');
      })
      .catch((error) => {
        alert(error.message);
      });
  };

  return (
    <div className="home-page">
      {/* Logo */}
      <div className="text-center mb-8">
        <img className="mx-auto w-20 h-20" src="/logo.png" alt="Logo de l'application" />
      </div>

      {/* Navbar */}
      <nav className="bg-gray-800 py-4 px-8 flex justify-between items-center mb-4">
        <div className="text-white text-xl">Goblo</div>
        <button className="text-white block sm:hidden">
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16m-7 6h7" />
          </svg>
        </button>
        <div className="hidden sm:flex items-center">
          <a href="/enrollment" className="text-white mx-2">Enroller</a>
          <a href="/encaisser" className="text-white mx-2">Encaisser</a>
          <a href="#" className="text-white mx-2">Rapports</a>
          <a href="#" className="text-white mx-2">Comptes</a>
          <a href="#" className="text-white mx-2">Contrôler</a>
          <a href="#" className="text-white mx-2">Décaisser</a>
        </div>
      </nav>

      {/* Card grid */}
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
        {/* Card 1 */}
        <a href="/enrollment" className="text-decoration-none">
          <Card className="cursor-pointer" style={{ background: '#CCCCCC33' }}>
            <div className="flex items-center justify-center h-20">
              <div className="bg-white rounded-full w-12 h-12 flex items-center justify-center">
                <img src="hommes.png" alt="Icône" className="w-8 h-8" />
              </div>
            </div>
            <Card.Body>
              <Card.Title className="font-semibold text-center">Enroller</Card.Title>
              <Card.Text className="text-center">Enregistrer les contribuables</Card.Text>
            </Card.Body>
          </Card>
        </a>
        {/* Ajoutez d'autres cartes de la même manière */}
      </div>

      {/* Bouton de déconnexion */}
      <Link to="/#" onClick={handleLogout} className="btn btn-primary">Déconnexion</Link>

      {/* Copyright */}
      <div className="text-center mt-8">
        <CopyrightText />
      </div>
    </div>
  );
}

export default HomePage;
